import React from "react";

const ActiveJournalEntriesBody = (props) => {
    return (
        <div>
            <p>{props.body}</p>
            <p>{props.conclusion}</p>
            <p>{props.id}</p>
            <button>Let go of this thought!</button>
        </div>
    )
}

export default ActiveJournalEntriesBody
